import React from 'react';
import Button from './Button'

function Info() {
    return(
        <div>
            <div className='info'>
                <img src='../logo192.png' alt='React logo' className='nav-logo'/>
                <h1>Sampson Thor</h1>

                <p>My profile website</p>
            </div>
            <div className='buttons'>
                <button name='Email' />
                <button name='LinkedIn' />
            </div>
        </div>
    )
}

export default Info;
